import React, { Component } from 'react';
import DataTable from '../../services/reactTable';
import comparisonColdef from './comparisonColdef';

class ComparisonMetricTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      attributes: ['Sales', 'Inventory', 'Margin'],
    };
  }

  render() {
    return (
      <div className="createMd ml-4 mr-4 pt-4 pb-4">
        {/* <div className="card mb-4"> */}
        {/* <ColumnSelection attributes={this.state.attributes} /> */}
        {this.props.showCheckBoxComparsionTable ? (
          <DataTable
            fileName="Comparison Metric Table"
            showExport={true}
            columns={comparisonColdef()}
            data={this.props.data ? Object.values(this.props.data) : []}
            visibleColumns="onlyRowSelection"
          />
        ) : (
          <DataTable
            fileName="Comparison Metric Table"
            showExport={true}
            columns={comparisonColdef()}
            data={Object.values(this.props.data)}
          />
        )}
        {/* </div> */}
      </div>
    );
  }
}

export default ComparisonMetricTable;
